import React from "react";
import"../src/node_module/bootstrap/dist/css/bootstrap.min.css";
import"../src/node_module/bootstrap/dist/css/bootstrap.bundle";
import Home from"../src/Home";
import Service from"../src/Service";
import About from"../src/About";
import Contact from"../src/Contact";
import Navbar from"../src/Navbar";
const App = ()=>{
    return(
        <>
        <Navbar/>
        <Home/>
        <Service/>
        <About/>
        <Contact/>
        </>
    );
};
export default App;
